(364,1712936415,2,'BE',1,0,8,'tx_surfcampcorporate_domain_model_accordion_item','{\"oldRecord\":{\"bodytext\":\"<p>Embark on your adventures with our versatile backpack, designed to be your ultimate companion wherever you roam. With smart organization, durable materials, and ergonomic design, it seamlessly balances style and functionality. Whether you\'re trekking through the wilderness or navigating the urban jungle, trust in our backpack to carry your essentials with ease and reliability.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>St\\u00fcrzen Sie sich in Ihre Abenteuer mit unserem vielseitigen Rucksack, der zu Ihrem ultimativen Begleiter wird, wo immer Sie auch unterwegs sind. Mit seiner intelligenten Organisation, den strapazierf\\u00e4higen Materialien und dem ergonomischen Design bringt er Stil und Funktionalit\\u00e4t nahtlos in Einklang. Ganz gleich, ob Sie durch die Wildnis wandern oder sich im Gro\\u00dfstadtdschungel bewegen, vertrauen Sie darauf, dass unser Rucksack Ihre wichtigsten Utensilien mit Leichtigkeit und Zuverl\\u00e4ssigkeit transportiert.<\\/p>\"}}',0,'0400$cc6f1fc7c5165600d4470efa87ccf0e6:97cafb9630c554e5e1e98b97c487cd09'),
