(444,1712939078,2,'BE',1,0,13,'tx_surfcampcorporate_domain_model_accordion_item','{\"oldRecord\":{\"header\":\"Features (copy 1)\",\"bodytext\":\"[Translate to Deutsch:] <ul><li>Advanced Neoprene Technology: Constructed with cutting-edge neoprene material for maximum flexibility and durability.<\\/li><li>Thermal Insulation: Provides superior insulation to keep you warm in cold waters, allowing you to stay in the water longer.<\\/li><li>Contoured Fit: Designed with a contoured fit for optimal range of motion and minimal drag, enabling effortless movement underwater.<\\/li><li>UV Protection: Offers UPF 50+ protection to shield your skin from harmful UV rays, ideal for prolonged exposure to the sun.<\\/li><li>Easy Entry System: Equipped with a streamlined entry system for hassle-free wearing and removal, saving you time and effort.<\\/li><li>Stylish Design: Combines functionality with style, featuring sleek aesthetics and vibrant color options to suit your personal preference.<\\/li><li>Versatile Performance: Perfect for a variety of water sports activities, including diving, surfing, and more, ensuring optimal performance in any aquatic environment.<\\/li><\\/ul>\"},\"newRecord\":{\"header\":\"Features\",\"bodytext\":\"<ul><li>Fortschrittliche Neopren-Technologie:&nbsp;<ul><li>Konstruiert mit modernstem Neoprenmaterial f\\u00fcr maximale Flexibilit\\u00e4t und Haltbarkeit.<\\/li><\\/ul><\\/li><li>Thermische Isolierung:&nbsp;<ul><li>Bietet eine hervorragende Isolierung, um Sie in kalten Gew\\u00e4ssern warm zu halten, so dass Sie l\\u00e4nger im Wasser bleiben k\\u00f6nnen.<\\/li><\\/ul><\\/li><li>Geformte Passform:&nbsp;<ul><li>Die konturierte Passform sorgt f\\u00fcr optimale Bewegungsfreiheit und minimalen Luftwiderstand und erm\\u00f6glicht m\\u00fchelose Bewegungen unter Wasser.<\\/li><\\/ul><\\/li><li>UV-Schutz:&nbsp;<ul><li>Bietet UPF 50+, um Ihre Haut vor sch\\u00e4dlichen UV-Strahlen zu sch\\u00fctzen, ideal bei l\\u00e4ngerem Aufenthalt in der Sonne.<\\/li><\