(1,9,1717956602,1712832457,0,0,0,0,2,0,0,NULL,0,'{\"t3_origuid\":\"\",\"l10n_parent\":\"\",\"header\":\"\",\"bodytext\":\"\",\"sys_language_uid\":\"\"}','Features','<ul><li>Tear-Resistant</li><li>waterproof</li><li>breathable back panel</li><li>easy access, adjustable compartments</li><li>removable , heat resistant compartment</li><li>new carry system ( load distribution , custom fit, AntiGravity suspension)</li><li>Gear Loops and D-Rings</li><li>side and hip belt mesh pockets</li></ul>',2,'tx_surfcampcorporate_domain_model_product'),
(2,9,1712936415,1712832457,0,0,0,0,1026,1,1,NULL,0,'{\"t3_origuid\":\"\",\"l10n_parent\":\"\",\"header\":\"\",\"bodytext\":\"\",\"sys_language_uid\":\"\"}','Merkmale','<ul><li>ReiÃŸfest</li><li>wasserdicht</li><li>atmungsaktive RÃ¼ckwand</li><li>leicht zugÃ¤ngliche, verstellbare FÃ¤cher</li><li>herausnehmbares, hitzebestÃ¤ndiges Fach</li><li>neues Tragesystem (Lastverteilung, individuelle Passform, AntiGravity-AufhÃ¤ngung)</li><li>Gewebe aus 100% recycelten Materialien</li><li>Materialschlaufen und D-Ringe</li><li>Netztaschen an der Seite und am HÃ¼ftgurt</li></ul>',4,'tx_surfcampcorporate_domain_model_product'),
(3,9,1717956602,1712843890,0,0,0,0,3,0,0,NULL,0,NULL,'Materials','<p>Fabric is made with 100% recycled materials.</p>\r\n<ul><li>Honeycomb recycled nylon</li><li>High-tenacity recycled nylon</li><li>High-tenacity recycled polyester (all bluesignÂ® approved)</li></ul>',2,'tx_surfcampcorporate_domain_model_product'),
(4,9,1712844037,1712843890,1,0,0,0,2,1,2,NULL,0,NULL,'Materials','<p>Fabric is made with 100% recycled materials.</p>',4,'tx_surfcampcorporate_domain_model_product'),
(5,9,1712848963,1712844037,1,0,0,0,3,1,3,NULL,3,NULL,'Materials (copy 1)','<p>Fabric is made with 100% recycled materials.</p>',4,'tx_surfcampcorporate_domain_model_product'),
(6,9,1717956602,1712846428,0,0,0,0,1,0,0,NULL,0,NULL,'General','<p><strong>Frame Material:</strong> Aluminum<br /><strong>Suspended Mesh Back Panel:</strong> Yes<br /><strong>Pack Access: </strong>Top and sides<br /><strong>Hipbelt Pockets:</strong> Yes<br /><strong>Adjustable Torso Length:</strong> Yes<br /><strong>Sleeping Bag Compartment: </strong>Yes</p>',2,'tx_surfcampcorporate_domain_model_product'),
(7,9,1712936415,1712846428,0,0,0,0,1027,1,3,NULL,0,NULL,'Materialien','<ul><li>Zu 100 % aus recycelten Materialien.</li><li>Recyceltes Nylon in Wabenform</li><li>Hochfestes recyceltes Nylon</li><li>Hochfestes, recyceltes Polyester (alle bluesignÂ®-zertifiziert)</li></ul>',4,'tx_surfcampcorporate_domain_model_product'),
(8,9,1712936415,1712848963,0,0,0,0,1,1,6,NULL,6,NULL,'Allgemein','<p>StÃ¼rzen Sie sich in Ihre Abenteuer mit unserem vielseitigen Rucksack, der zu Ihrem ultimativen Begleiter wird, wo immer Sie auch unterwegs sind. Mit seiner intelligenten Organisation, den strapazierfÃ¤higen Materialien und dem ergonomischen Design bringt er Stil und FunktionalitÃ¤t nahtlos in Einklang. Ganz gleich, ob Sie durch die Wildnis wandern oder sich im GroÃŸstadtdschungel bewegen, vertrauen Sie darauf, dass unser Rucksack Ihre wichtigsten Utensilien mit Leichtigkeit und ZuverlÃ¤ssigkeit transportiert.</p>',4,'tx_surfcampcorporate_domain_model_product'),
(9,9,1717956622,1712934970,0,0,0,0,2,0,0,NULL,0,NULL,'Features','<ul><li>Advanced Neoprene Technology: Constructed with cutting-edge neoprene material for maximum flexibility and durability.</li><li>Thermal Insulation: Provides superior insulation to keep you warm in cold waters, allowing you to stay in the water longer.</li><li>Contoured Fit: Designed with a contoured fit for optimal range of motion and minimal drag, enabling effortless movement underwater.</li><li>UV Protection: Offers UPF 50+ protection to shield your skin from harmful UV rays, ideal for prolonged exposure to the sun.</li><li>Easy Entry System: Equipped with a streamlined entry system for hassle-free wearing and removal, saving you time and effort.</li><li>Stylish Design: Combines functionality with style, featuring sleek aesthetics and vibrant color options to suit your personal preference.</li><li>Versatile Performance: Perfect for a variety of water sports activities, including diving, surfing, and more, ensuring optimal performance in any aquatic environment.</li></ul>',3,'tx_surfcampcorporate_domain_model_product'),
(10,9,1717949625,1712935203,0,0,0,0,1,0,0,NULL,0,NULL,'Features','<ul><li>for all sport activities</li><li>Super fast drying</li><li>super light and small packsize</li><li>eco friendly production in spain</li><li>Amazing TYPO3 logo</li><li>Also available with your own prints</li><li>Vibrant Colors</li><li>Loop for easy hanging</li><li>no fuzzing</li><li>reduced prizing for larger amounts</li></ul>',1,'tx_surfcampcorporate_domain_model_product'),
